import React from "react";
import logo from "../images/logo.svg";
import { Outlet } from "react-router-dom";
const Layout = () => {
  return (
    <div>
      <h1>sdgsdgsdgg</h1>
      <div>
        <img className="logo" src={logo} alt="logo" />
      </div>
      <Outlet />
    </div>
  );
};
export default Layout;
